import React, { useState }  from "react";
import axios from 'axios';

// reactstrap components
import { Button, Container, Row, Col } from "reactstrap";

import { Link } from "react-router-dom";
// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import DarkFooter from "components/Footers/DarkFooter.js";

function WalkingPage() {
  const [names,setNames]=useState([]);

  React.useEffect(() => {
    let isSubscribed = true;
    axios
    .get('/api/getwalking')
    .then(Response => {
      
      if (Response.status === 200) {
        if (isSubscribed) {    
        setNames(Response.data.response.body.items.item);
        console.log(Response.data.response.body.items.item);
       // check if this component still mounted

         //setLoading(false);
       }
     }
    });
    //.catch((Error)=>{console.log(Error)});

    document.body.classList.add("walking-page");
    document.body.classList.add("sidebar-collapse");
    document.documentElement.classList.remove("nav-open");
    window.scrollTo(0, 0);
    document.body.scrollTop = 0;
    return function cleanup() {
      document.body.classList.remove("walking-page");
      document.body.classList.remove("sidebar-collapse");
    };
  }, []);

  const Namelists= names.map((name)=> {
           const searchurl="https://search.daum.net/search??w=tot&&q="+ name.trrsrtNm
           const mapurl="https://map.kakao.com/link/to/,"+name.trrsrtNm+"," +name.latitude+","+name.longitude

        return(
          <div className="section3 section-nucleo-icons">
    
          <Container>
              <Row>
                <Col lg="6" md="12">
                  <h2 className="title">{name.trrsrtNm}  <div className="suggestdetail"><Link to={link} > +사진</Link></div></h2>
                 <h5 className="description">
                    {name.trrsrtIntrcn}
                  </h5>
                  <Button
                    className="btn-detail"
                    color="info"
                    size="lg"
                    href = {searchurl}
                    target="_blank"
                  > 자세히
                  </Button>
                  <Button
                    className="btn-direction"
                    color="info"
                    href={mapurl}
                    outline
                    size="lg"
                    target="_blank"
                  >
                    길찾기
                  </Button>
                </Col>
              </Row>
            </Container>
          </div>
       );
  }
);

  return (
    <><>
      <ExamplesNavbar />
      <div className="page-header clear-filter">
        <div
          className="page-header-image"
          style={{
            backgroundImage: "url(" + require("assets/img/login1.jpg").default + ")",
          }}
        ></div>
      </div>



    </><div class="zone_wrap">
        <div class="list_zone">
          <div class="tit">
            <h2 id="zoneTitle">뚜벅여행</h2>
          </div>
          {Namelists}
        </div>
      </div>
      
      
      
      
      <DarkFooter /></>
  );
}

export default WalkingPage;
